import React from "react";
import "../css/list.css";

const List = (positions) => {   
    console.log(positions);

    return (
        <React.Fragment>
            <div className="list_wrap">
                {positions.map((position, index) => (
                    <div key={index}>
                        {position.name}
                    </div>
                ))}
            </div>
        </React.Fragment>
    )
}

export default List;
